import React from "react";
// import ReactDOM from "react-dom";

const Second =() => {
    return(
        <React.Fragment>
            <h1>Netflix Picks</h1>
            <p>List of 5 Movies</p>
            <ol type="I">
                <li>Dark</li>
                <li>Extra</li>
                <li>Circular</li>
                <li>Each</li>
                <li>Love</li>
            </ol>
        </React.Fragment>
    )
}

